import React, { Component } from "react";
import { Navbar,Nav,NavDropdown,Form,FormControl,Button } from 'react-bootstrap'




import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import Upload from "./imageUpload";
import Usage from "./usage";

export default class Main extends Component {
    render(){
        
        return(
            <div>
                <div className="row">
                    <div className="col-md-12">
                            <Navbar bg="dark" variant="dark" expand="lg" sticky="top">
                                <Navbar.Brand href="#home">Caption It !</Navbar.Brand>
                                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                                <Navbar.Collapse id="basic-navbar-nav">
                                    <Nav className="mr-auto">
                                    <Nav.Link href="/upload" isUpload="isUpload">Upload an image</Nav.Link>
                                    
                                    <Nav.Link href="/usage" isUsage="isUsage">My usage</Nav.Link>
                                    
                                    
                                    </Nav>
                                    <Nav>
                                    <Nav.Link class="navbar-brand pull-right" href="/logout">Logout</Nav.Link></Nav>
                                </Navbar.Collapse>
                            </Navbar>
                            <br />
                        
                    </div>
                </div>
                <Upload isUpload={this.props.isUpload}/>
                <Usage isUpload={this.props.isUsage}/>
            </div>
        )  
    }
}
